package com.itwill.giga_box.wish_movie;
//찜하기
public class Wish_movie {
	private int wish_no; //찜하기 고유번호
	private int movie_no; //영화번호
	private String m_id; //아이디
	
	public Wish_movie() {
		// TODO Auto-generated constructor stub
	}
	
	
	


	public Wish_movie(int wish_no, int movie_no, String m_id) {
		super();
		this.wish_no = wish_no;
		this.movie_no = movie_no;
		this.m_id = m_id;
	}




	public int getMovie_no() {
		return movie_no;
	}

	public void setMovie_no(int movie_no) {
		this.movie_no = movie_no;
	}

	public String getM_id() {
		return m_id;
	}

	public void setM_id(String m_id) {
		this.m_id = m_id;
	}

	public int getWish_no() {
		return wish_no;
	}

	public void setWish_no(int wish_no) {
		this.wish_no = wish_no;
	}





	@Override
	public String toString() {
		return "Wish_moive [wish_no=" + wish_no + ", movie_no=" + movie_no + ", m_id=" + m_id + "]";
	}
	
	
	

}
